const chan = $('Split Out list array').all()[$runIndex].json.chan;
const path = $("Search for the given path").all()[$runIndex].json;
const file = $("Search for video_ledger spreadsheet").all()[$runIndex].json;
const raw = $("Get the YouTube data").all();
const ctl = $("Get the ScheduleControl data").first().json;
const rtrn = [];

for (let idx in raw) {
  rtrn.push({chan: chan, path: path, file: file, ctl: ctl, row: raw[idx].json});
}

return {data: rtrn}

const raw = $("Switch").item.json.ctl
const vidId = $("Get HOA Nightmares video").item.json.id
const vidTitle = $("Get HOA Nightmares video").item.json.snippet.title
const vidCategory = $("Get HOA Nightmares video").item.json.snippet.categoryId
const sheetId = $("Search for video_ledger spreadsheet").first().json.id

const node = $getWorkflowStaticData('node');

if (typeof node.tctl === 'undefined') {
  node.tctl = raw.TimeCtl + $runIndex
  node.date = raw.Date
}
if (node.tctl > 2) {
  node.tctl = 1
}

if (node.tctl == 2) {
  node.scheduleDate = DateTime.fromISO(node.date).plus({days: 1}).plus({hour: raw.TimeAM.split(':')[0]}).toISO({ suppressMilliseconds: true })
  node.nextTimeCtl = 1
  node.nextDate = DateTime.fromISO(node.scheduleDate).toFormat('yyyy-MM-dd')
} else {
  node.scheduleDate = DateTime.fromISO(node.date).plus({hour: raw.TimePM.split(':')[0]}).toISO({ suppressMilliseconds: true })
  node.nextTimeCtl = 2
  node.nextDate = DateTime.fromISO(node.scheduleDate).toFormat('yyyy-MM-dd')
}

node.tctl += 1
node.date = node.nextDate
return {vidId, vidTitle, vidCategory, sheetId, rawDate: raw.Date, rawCtl: raw.TimeCtl, scheduleDate: node.scheduleDate, nextDate: node.nextDate, nextTimeCtl: node.nextTimeCtl, tctl: node.tctl}

